      "normalizedText": "copilot prompting tips & tricks principles that make prompts work 1) purpose over prose state the goal first. copilot performs best when it knows the outcome you want, not just the topic. try: “create a one‑page executive brief that explains why this matters and what to decide.” 2) context is king reference specific files, tables, or pages. copilot can’t infer what you didn’t provide. attach or cite the source. “use the q2_finance.xlsx sheet ‘bookings’.” 3) constraints guide quality boundaries like length, tone, structure, or audience keep outputs on target. “limit to 200 words, plain language, with 3 bullets for risks.” 4) iterate like a teammate ask for assumptions, request alternatives, and refine quickly rather than trying for a perfect first prompt. follow with: “list assumptions you made. what’s missing?” scroll for structure → reusable anatomy a reliable prompt structure g • goal what do you want? (summary, draft, plan, analysis, slides) who is it for? (audience & reading level)",
